/**
 * Get SOL price for a specific timestamp (Daily Precision)
 * @param {number|string} timestamp 
 * @returns {number} Price in USD
 */
export function getHistoricalSolPrice(timestamp) {
    if (!timestamp) return null; // Default fallback

    try {
        const date = new Date(timestamp);
        const key = date.toISOString().split('T')[0];

        // Exact match
        if (SOL_DAILY_PRICES[key]) return SOL_DAILY_PRICES[key];

        // Fallback: Check month/year if daily missing? 
        // Just return nearest available or default.
        return null;
    } catch (e) {
        return null;
    }
}
